import Carousel from "react-bootstrap/Carousel";
import sacemext1 from "../images/sacem_ext1.jpg";
import sacemext2 from "../images/sacemext2.jpg";
import sacemtrans1 from "../images/chaud.jpg";

function ImagesCarousel() {
  return (
    <Carousel data-bs-theme="dark" fade>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={sacemext1}
          alt="First slide"
          style={{ width: "1580px", height: "460px", marginRight: "30px" }}
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={sacemext2}
          alt="Second slide"
          style={{ width: "1580px", height: "460px", marginRight: "30px" }}
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={sacemtrans1}
          alt="Third slide"
          style={{ width: "1580px", height: "460px", marginRight: "30px" }}
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://media.istockphoto.com/id/537373196/fr/photo/arbres-formant-un-c%C5%93ur.jpg?s=612x612&w=0&k=20&c=TsmnjaWlfPIOnUuWgGcvX1CGFKPOdlq-Iqsy_eNZtXs="
          alt="First slide"
          style={{ width: "1580px", height: "460px", marginRight: "30px" }}
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://media.istockphoto.com/id/537373196/fr/photo/arbres-formant-un-c%C5%93ur.jpg?s=612x612&w=0&k=20&c=TsmnjaWlfPIOnUuWgGcvX1CGFKPOdlq-Iqsy_eNZtXs="
          alt="First slide"
          style={{ width: "1580px", height: "460px", marginRight: "30px" }}
        />
      </Carousel.Item>
    </Carousel>
  );
}

export default ImagesCarousel;
